import styled, { css } from "styled-components"

const primaryColor = css`
    color:#448487
`
const Homepage = styled.div`
    width:1140px;
    margin:0 auto;
    ${primaryColor};
    .background{
        width: 100%;
        height:700px
    }
`
export default Homepage
